INSERT INTO `catalog_product_entity_text` VALUES (1,85,0,1,'Thức ăn cho chó ANF6 Free Dog hạt hữu cơ'),(2,75,0,1,'<style>#html-body [data-pb-style=I3YMD8U]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"I3YMD8U\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">										\r\n								\r\n											&lt;h2&gt;&lt;em&gt;&lt;strong&gt;Hạt cho chó Smart Heart Mother Baby Dog 15kg Thức ăn cho chó bầu và chó sơ sinh - CutePets&lt;/strong&gt;&lt;/em&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Trọng lượng: 15Kg (Bao xá nguyên 15Kg x 1 bao)&lt;br&gt;\r\nMÔ TẢ SẢN PHẨM&lt;br&gt;\r\n&amp;nbsp; Chăm sóc Cún mẹ sau sinh là công việc rất quan trọng và mang tính quyết định cho sức khỏe của Cún mẹ. Vì vậy hãy lưu ý các cách chăm sóc Cún mẹ sau sinh tốt nhất như sau:&lt;br&gt;\r\n- Không cho Cún mẹ ăn thức ăn tanh, nhiều mỡ đề phòng dẫn đến tiêu chảy, mất sữa.&lt;br&gt;\r\n- Kiểm tra tuyến vú của Cún mẹ hàng ngày đề phòng mắc bệnh viêm vú (mastitis).&lt;br&gt;\r\n- Đưa Cún mẹ đến bác sĩ thú y để kiểm tra nếu thấy dịch tiết âm đạo chuyển màu từ nâu đỏ sang xanh, xám.&amp;nbsp;&lt;br&gt;\r\n- Cho Cún mẹ ăn SmartHeart Mother &amp;amp; Baby Dog sản phẩm có đủ các chất dinh dưỡng giúp Cún mẹ có nhiều sữa.&lt;br&gt;\r\n&amp;nbsp; Đáp ứng nhu cầu dinh dưỡng cho sự phát triển và quá trình mang thai của chó được quy định bởi Hiệp hội Thức ăn chăn nuôi Hoa Kỳ AAFCO.&amp;nbsp;&lt;br&gt;\r\n&amp;nbsp; Thức ăn SmartHeart dành cho chó mang thai và chó con sản xuất theo tiêu chuẩn BRC-, ISO 14001 và HACCP chưng nhận sản xuất thức ăn dành cho thú cưng.&amp;nbsp;&lt;br&gt;\r\nNguyên liệu chính: Bột gia cầm, gạo, protein đậu tương, mỡ gà, dầu đậu tương, gluten ngô, nấm men sấy khô, premix khoáng, củ cải đường, dầu cá, lecithin, gum, sữa không béo, galacto oligosaccharide, premix vitamin, chất chống oxi hóa, chiết xuất yucca.&amp;nbsp;&lt;br&gt;\r\nThành phần dinh dưỡng: Độ ẩm tối đa (10,00% (tối đa), đạm thô 28,00%, xơ thô 5,00% (tối đa), khoáng tổng số 10,00% (tối đa), chất béo tổng số 18,00% (tối thiểu).&amp;nbsp;&lt;br&gt;\r\nHướng dẫn bảo quản: Luôn giữ sản phẩm còn lại trong túi hoặc thùng kín.&amp;nbsp;&lt;br&gt;\r\nBảo quản sản phẩm ở nơi khô ráo, thoáng mát, tránh tiếp xúc trực tiếp với ánh sáng mặt trời.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Prebiotics là những chất xơ có nguồn gốc tự nhiên giúp tăng số lần đi ngoài của Cún, giúp cải thiện chất lượng phân và giảm mùi hôi.&lt;br&gt;\r\n- Hỗ trợ vi khuẩn có lợi cho đường ruột Lactobacillus, Bifidobacteria giúp chúng phát triển vượt trội giúp hệ tiêu hóa khỏe mạnh.&lt;br&gt;\r\n- SmartHeart Mother &amp;amp; Baby Dog cung cấp Prebiotic và các dinh dưỡng cần thiết giúp Cún mẹ và Cún con có hệ tiêu hóa khỏe mạnh.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=\"Hạt cho chó Smart Heart Mother Baby Dog 15kg Thức ăn cho chó bầu và chó sơ sinh - CutePets\" src=\"//bizweb.dktcdn.net/100/307/433/products/hat-cho-cho-smart-heart-mother-baby-dog-15kg-thuc-an-cho-cho-bau-va-cho-so-sinh-cutepets2.jpg?v=1646126246397\" style=\"height:720px; width:720px\"&gt;&lt;img alt=\"Hạt cho chó Smart Heart Mother Baby Dog 15kg Thức ăn cho chó bầu và chó sơ sinh - CutePets\" src=\"//bizweb.dktcdn.net/100/307/433/products/hat-cho-cho-smart-heart-mother-baby-dog-15kg-thuc-an-cho-cho-bau-va-cho-so-sinh-cutepets1.jpg?v=1646126246397\" style=\"height:720px; width:720px\"&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Ngày sản xuất: In trên bao bì&lt;br&gt;\r\n- Hạn sử dụng: &amp;nbsp;In trên bao bì&lt;br&gt;\r\n----------------------------------------------------------&lt;br&gt;\r\n- Xuất xứ: Thái Lan&lt;br&gt;\r\n- Công ty sản xuất: TNHH Perfect Companion Group&lt;br&gt;\r\n- Địa chỉ công ty: Bangsaothong, Samutprakam, 10570 Thailand&lt;/p&gt;\r\n\r\n&lt;p&gt;- Nhà NK &amp;amp; PP: TNHH Perfect Companion Việt Nam&lt;br&gt;\r\n\r\n</div></div></div>'),(9,75,0,5,'<style>#html-body [data-pb-style=N4HMOR2]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"N4HMOR2\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">									\r\n								\r\n											Thức ăn cho chó nhỏ Dog Mania Puppy - Cutepets\r\n- Trọng Lượng: 1.5kg \r\nThức ăn DOG MANIA PUPPYcung cấp đầy đủ dưỡng chất cho cún con. Đặc biệt THỨC ĂN CHO CHÓ DOG MANIA PUPPY đảm bảo cân đối giữa protein và chất xơ, vitamin, khoáng chất …. Giúp những chú chó yêu có những bữa ăn ngon và quan trọng hơn cả THỨC ĂN DOG MANIA PUPPY giúp giảm mùi hôi của phân thải ra.\r\nĐẶC ĐIỂM CỦA THỨC ĂN CHO CHÓ DOG MANIA PRIMIUM PUPPY\r\n- Dạng viên: thức ăn dạng viên tròn \r\n-&amp;nbsp;Độ tuổi: Cho chó nhỏ dưới 12 tháng\r\n\r\nĐặc điểm của Thức ăn cho chó Dog Mania Puppy\r\n– Được chế biến từ thịt gà tươi và mỡ gà. \r\n– Chứa nhiều protein, khoáng chất, canxi &amp;amp; lợi khuẩn giúp cún con hoàn thiện các chức năng của cơ thể và phát triển sức khỏe tốt nhất. \r\n– Nguyên liệu cao cấp và chế biến trên dây chuyền hiện đại tại Hàn. \r\n– Giúp giảm thiểu mùi hôi của phân\r\n</div></div></div>'),(10,85,0,5,'Thức ăn cho chó nhỏ Dog Mania Puppy'),(11,75,0,6,'<style>#html-body [data-pb-style=N4HMOR2]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"N4HMOR2\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">									\r\n								\r\n											Thức ăn cho chó nhỏ Dog Mania Puppy - Cutepets\r\n- Trọng Lượng: 1.5kg \r\nThức ăn DOG MANIA PUPPYcung cấp đầy đủ dưỡng chất cho cún con. Đặc biệt THỨC ĂN CHO CHÓ DOG MANIA PUPPY đảm bảo cân đối giữa protein và chất xơ, vitamin, khoáng chất …. Giúp những chú chó yêu có những bữa ăn ngon và quan trọng hơn cả THỨC ĂN DOG MANIA PUPPY giúp giảm mùi hôi của phân thải ra.\r\nĐẶC ĐIỂM CỦA THỨC ĂN CHO CHÓ DOG MANIA PRIMIUM PUPPY\r\n- Dạng viên: thức ăn dạng viên tròn \r\n-&amp;nbsp;Độ tuổi: Cho chó nhỏ dưới 12 tháng\r\n\r\nĐặc điểm của Thức ăn cho chó Dog Mania Puppy\r\n– Được chế biến từ thịt gà tươi và mỡ gà. \r\n– Chứa nhiều protein, khoáng chất, canxi &amp;amp; lợi khuẩn giúp cún con hoàn thiện các chức năng của cơ thể và phát triển sức khỏe tốt nhất. \r\n– Nguyên liệu cao cấp và chế biến trên dây chuyền hiện đại tại Hàn. \r\n– Giúp giảm thiểu mùi hôi của phân\r\n</div></div></div>'),(12,85,0,6,'Thức ăn cho chó nhỏ Dog Mania Puppy'),(13,75,0,7,'<style>#html-body [data-pb-style=N4HMOR2]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"N4HMOR2\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">									\r\n								\r\n											Thức ăn cho chó nhỏ Dog Mania Puppy - Cutepets\r\n- Trọng Lượng: 1.5kg \r\nThức ăn DOG MANIA PUPPYcung cấp đầy đủ dưỡng chất cho cún con. Đặc biệt THỨC ĂN CHO CHÓ DOG MANIA PUPPY đảm bảo cân đối giữa protein và chất xơ, vitamin, khoáng chất …. Giúp những chú chó yêu có những bữa ăn ngon và quan trọng hơn cả THỨC ĂN DOG MANIA PUPPY giúp giảm mùi hôi của phân thải ra.\r\nĐẶC ĐIỂM CỦA THỨC ĂN CHO CHÓ DOG MANIA PRIMIUM PUPPY\r\n- Dạng viên: thức ăn dạng viên tròn \r\n-&amp;nbsp;Độ tuổi: Cho chó nhỏ dưới 12 tháng\r\n\r\nĐặc điểm của Thức ăn cho chó Dog Mania Puppy\r\n– Được chế biến từ thịt gà tươi và mỡ gà. \r\n– Chứa nhiều protein, khoáng chất, canxi &amp;amp; lợi khuẩn giúp cún con hoàn thiện các chức năng của cơ thể và phát triển sức khỏe tốt nhất. \r\n– Nguyên liệu cao cấp và chế biến trên dây chuyền hiện đại tại Hàn. \r\n– Giúp giảm thiểu mùi hôi của phân\r\n</div></div></div>'),(14,85,0,7,'Thức ăn cho chó nhỏ Dog Mania Puppy'),(15,75,0,8,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;p&gt;&lt;em&gt;&lt;strong&gt;Thức ăn cho chó Dog Mania Premium 400g - CutePets&lt;/strong&gt;&lt;/em&gt;&lt;br&gt;\r\n- Trọng lượng: Gói 400g&lt;br&gt;\r\nThức ăn cho chó Dog Mania Premium là loại Thức ăn hạt cao cấp dành cho chó được nhập khẩu trực tiếp từ Hàn Quốc. Thức ăn cho chó Dog Mania đã được khẳng định tên tuổi trên toàn thế giới.&lt;br&gt;\r\nThức ăn cho chó Dog Mania Premium được sản xuất bằng nguyên liệu cao cấp với thịt gà tươi và độ ngậy từ mỡ gà. Thức ăn Dog Mania cung cấp đầy đủ dưỡng chất cho chó ở mọi loại độ tuổi. Đặc biệt Thức ăn cho chó Dog Mania Premium đảm bảo cân đối giữa protein và chất xơ, vitamin, khoáng chất …. Giúp những chú chó yêu có những bữa ăn ngon và quan trọng hơn cả là Thức ăn Dog Mania Premium giúp giảm mùi hôi của phân thải ra&lt;br&gt;\r\n&lt;strong&gt;Đặc điểm nổi bật&lt;/strong&gt;&lt;br&gt;\r\n&amp;nbsp;- Được chế biến từ thịt gà tươi và mỡ gà&lt;br&gt;\r\n&amp;nbsp;- Nguyên liệu cao cấp&lt;br&gt;\r\n&amp;nbsp;- Giúp giảm thiểu mùi hôi của phân&lt;br&gt;\r\nKhuyến cáo lượng thức ăn cho chó ăn theo trọng lượng khi sử dụng Thức ăn cho chó Dog Mania Premium&lt;br&gt;\r\n&amp;nbsp;- Trọng lượng chó nhỏ hơn 5kg: cho ăn 55 – 65gr – Trọng lượng chó từ 6 – 10kg: cho ăn 65 – 88gr&lt;br&gt;\r\n&amp;nbsp;- Trọng lượng chó từ 11 – 23kg: cho ăn 80 – 180gr – Trọng lượng chó lớn hơn 23kg: cho ăn 150 – 300 gr&lt;br&gt;\r\nTùy từng giống chó khác nhau mà lượng cho chó ăn sẽ là khác nhau&lt;br&gt;\r\nThành phẩn dinh dưỡng:&lt;br&gt;\r\n&amp;nbsp;- Protein thô: tối thiểu 22%&lt;br&gt;\r\n&amp;nbsp;- Béo thô: tối thiểu 10%&lt;br&gt;\r\n&amp;nbsp;- Nguyên liệu: Thịt gà, bột gạo, mỡ gà, dầu cá, củ cải nghiền, chiết xuất cây Yucca, các vitamin và khoáng chất&lt;br&gt;\r\nThông số sản phẩm&lt;br&gt;\r\n&amp;nbsp;- Thương hiệu: ANF&lt;br&gt;\r\n&amp;nbsp;- Loại sản phẩm: Thức ăn hạt cho chó&lt;br&gt;\r\n&amp;nbsp;- Health Benefit: &amp;nbsp;Sking &amp;amp; coat&lt;br&gt;\r\n&amp;nbsp;- &amp;nbsp;Đối tượng sử dụng: dành cho mọi lứa tuổi&lt;br&gt;\r\n&amp;nbsp;- Dạng viên: thức ăn dạng viên tròn - Trọng lượng: 5kg&lt;br&gt;\r\n&amp;nbsp;- Sản xuất tại Korea&lt;br&gt;\r\n&lt;/p&gt;</div>'),(16,85,0,8,'Thức ăn cho chó Dog Mania Premium 400g '),(17,75,0,9,'<style>#html-body [data-pb-style=C5HXTC0]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"