t;&lt;div class=\"aplus-module-wrapper apm-fixed-width\"&gt;&lt;div class=\"apm-spacing apm-wrap\"&gt;&lt;div class=\"apm-floatleft apm-wrap\"&gt;&lt;div class=\"apm-leftimage\"&gt;&lt;img alt=\"\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/ea1cc88a-788a-4dd7-ba8c-e0a83d172c6d._SR285,285_.png\" class=\"a-spacing-mini\" data-mce-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/ea1cc88a-788a-4dd7-ba8c-e0a83d172c6d._SR285,285_.png\"&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;p&gt;&lt;span class=\"a-size-small a-color-secondary\"&gt;Petcube Bites HD 1080p Interactive Pet Camera.&lt;/span&gt;&lt;/p&gt;&lt;/div&gt;&lt;div class=\"apm-rightthirdcol\"&gt;&lt;div class=\"apm-rightthirdcol-inner\"&gt;&lt;img alt=\"\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/28314808-3c6e-4f6b-9205-1969863775ad._SR230,100_.png\" class=\"a-spacing-mini\" data-mce-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/28314808-3c6e-4f6b-9205-1969863775ad._SR230,100_.png\"&gt;&lt;h5 class=\"a-color-secondary\"&gt;Designed for Pet Parents&lt;/h5&gt;&lt;p class=\"a-spacing-small a-size-small a-color-secondary\"&gt;Petcube is reinventing pet care, and is one of the bestselling pet camera brand. Winner of the 2017 Edison Award for Innovation and Wearable Award for Smart Home.&lt;/p&gt;&lt;p class=\"a-spacing-small a-size-small a-color-secondary\"&gt;Petcube supports rescues. Through the free Petcube App, play with adoptable pets from our rescue partners. With over 100,000 satisfied pet parents.&lt;/p&gt;&lt;p class=\"a-spacing-small a-size-small a-color-secondary\"&gt;Download the free Petcube App now and try before you buy it.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=\"apm-centerthirdcol apm-wrap\"&gt;&lt;h3 class=\"a-spacing-mini\"&gt;Petcube Bites Treat Camera&lt;/h3&gt;&lt;h4 class=\"a-spacing-mini a-color-secondary a-text-italic\"&gt;See, talk, toss treats, and reward your pet remotely&lt;/h4&gt;&lt;p class=\"a-spacing-base\"&gt;From the app on your phone, see your pet in clear HD and night vision, fling treats, say hello using two-way talk, and get motion and sound alerts. Have peace of mind that your furkid &amp;amp; home are safe.&lt;/p&gt;&lt;p class=\"a-spacing-base\"&gt;Stylish and durable, this cam will look good in any interior, comes with a high capacity two-pound container. Also works with Amazon Alexa. Just ask Alexa to treat your pet, go hands-free.&lt;/p&gt;&lt;p class=\"a-spacing-base\"&gt;Free basic video cloud storage plan is included. Tasty and healthy Wellness brand Dog Treats are included.&lt;/p&gt;&lt;div class=\"amp-centerthirdcol-listbox\"&gt;&lt;div class=\"apm-listbox amp-centerthirdcol-listbox a-box a-color-alternate-background a-spacing-small\"&gt;&lt;div class=\"a-box-inner\"&gt;&lt;ul class=\"a-unordered-list a-vertical\"&gt;&lt;li&gt;&lt;span class=\"a-list-item\"&gt;&lt;span class=\"a-size-base a-color-secondary\"&gt;Easy setup with iPhone and Android smartphones via the free Petcube app. iOS 9.3 and higher or Android 5.1 and higher (2.4GHz WiFi)&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span class=\"a-list-item\"&gt;&lt;span class=\"a-size-base a-color-secondary\"&gt;Compatible with a variety of dry, crunchy dog and cat treats. Usually flings 1-5 treats at a time. Control the amount of treats dispensed via an adjustable app setting for small and large treats&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span class=\"a-list-item\"&gt;&lt;span class=\"a-size-base a-color-secondary\"&gt;Multi-cam ability: connect up 6 cameras to your account and keep tabs on all of the important areas of your home.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=\"celwidget aplus-module module-4\" cel_widget_id=\"aplus-module-4\"&gt;&lt;div aria-live=\"polite\" data-a-expander-name=\"aplus-module-expander\" data-a-expander-collapsed-height=\"700\" class=\"a-expander-collapsed-height a-row a-expander-container a-expander-partial-collapse-container\"&gt;&lt;div aria-expanded=\"false\" class=\"a-expander-content a-expander-partial-collapse-content\"&gt;&lt;div class=\"aplus-module-wrapper\"&gt;&lt;div class=\"apm-spacing\"&gt;&lt;div class=\"apm-floatleft\"&gt;&lt;h3 class=\"a-spacing-small a-color-secondary\"&gt;App-Enabled Pet Care and Home Security&lt;/h3&gt;&lt;div class=\"a-spacing-extra-large\"&gt;&lt;div class=\"apm-spacing\"&gt;&lt;table class=\"apm-fixed-width a-spacing-mini apm-fourthcol-table mce-item-table\"&gt;&lt;tbody&gt;&lt;tr&gt;&lt;th class=\"apm-center\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;p&gt;&lt;img alt=\"\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/418a59fc-240a-4fbc-8a61-4146a8faec22._SL220__.png\" data-mce-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/418a59fc-240a-4fbc-8a61-4146a8faec22._SL220__.png\"&gt;&lt;/p&gt;&lt;/div&gt;&lt;/th&gt;&lt;th class=\"apm-center\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;p&gt;&lt;img alt=\"\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8b46a16b-680f-4241-af44-e2480ef1c2d7._SL220__.png\" data-mce-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/8b46a16b-680f-4241-af44-e2480ef1c2d7._SL220__.png\"&gt;&lt;/p&gt;&lt;/div&gt;&lt;/th&gt;&lt;th class=\"apm-center\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;p&gt;&lt;img alt=\"\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/aa0ceec7-6544-4420-958e-51c438697ce0._SL220__.png\" data-mce-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/aa0ceec7-6544-4420-958e-51c438697ce0._SL220__.png\"&gt;&lt;/p&gt;&lt;/div&gt;&lt;/th&gt;&lt;th class=\"apm-center\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;p&gt;&lt;img alt=\"\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e60d6063-7e2b-49e1-8fec-58e0f3023826._SL220__.png\" data-mce-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e60d6063-7e2b-49e1-8fec-58e0f3023826._SL220__.png\"&gt;&lt;/p&gt;&lt;/div&gt;&lt;/th&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td class=\"apm-top\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;h4 class=\"a-spacing-mini\"&gt;Monitor &amp;amp; Fling Treats Remotely&lt;/h4&gt;&lt;p class=\"a-size-small\"&gt;Toss treats from your smartphone varying distances - up to 6 feet. From the Petcube App, fling treats Angry-Birds style, or schedule automatic custom treat dispensing. Receive a notification when your device is running low on treats. Wellness dog treats are included with each purchase.&lt;/p&gt;&lt;p class=\"a-size-small\"&gt;Petcube Bites treat cam is compatible with a variety of treat brands. Use crunchy treats with dimensions of 1” or less. Custom in-app setting to small or large treats.&lt;/p&gt;&lt;/div&gt;&lt;/td&gt;&lt;td class=\"apm-top\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;h4 class=\"a-spacing-mini\"&gt;Petcube Care: 24/7 video recording&lt;/h4&gt;&lt;p class=\"a-size-small\"&gt;Every camera comes with a 7-day free trial subscription to a Petcube Care membership: 24/7 video cloud storage and interactive video timeline clips, triggered by sound and motion notification. You can opt to continue your subscription to get up to 30 days of video history plus members-only pet care perks. After your Petcube Care trial ends, you’ll still get the latest 4-hour video history of your pet’s activities for free.&lt;/p&gt;&lt;/div&gt;&lt;/td&gt;&lt;td class=\"apm-top\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;h4 class=\"a-spacing-mini\"&gt;Spy with Night Vision&lt;/h4&gt;&lt;p class=\"a-size-small\"&gt;Find out what your pets are up to in the middle of the night. In low light and no-light conditions, see things clearly with the night vision feature and be sure your pet is safe.&lt;/p&gt;&lt;p class=\"a-size-small\"&gt;With 3x digital zoom no detail will escape you, day or night.&lt;/p&gt;&lt;p class=\"a-size-small\"&gt;Easily save videoclips from your timeline to share with friends and family.&lt;/p&gt;&lt;/div&gt;&lt;/td&gt;&lt;td class=\"apm-top\"&gt;&lt;div class=\"apm-fourthcol\"&gt;&lt;h4 class=\"a-spacing-mini\"&gt;Petcube Care: membership perks&lt;/h4&gt;&lt;p class=\"a-size-small\"&gt;Petcube Care is an optional subscription service. Members save on deeply-discounted offers, vetted and curated by the Petcube team: Trupanion pet insurance, free Audible audiobooks, free on-demand live chat and phone calls with a vet tech from Vetted, free trials to DOGTV, Cat DNA kits from Basepaws, Tile, and many more&lt;/p&gt;&lt;/div&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=\"celwidget aplus-module module-12\" cel_widget_id=\"aplus-module-12\"&gt;&lt;div aria-live=\"polite\" data-a-expander-name=\"aplus-module-expander\" data-a-expander-collapsed-height=\"360\" class=\"a-expander-collapsed-height a-row a-expander-container a-expander-partial-collapse-container\"&gt;&lt;div aria-expanded=\"false\" class=\"a-expander-content a-expander-partial-collapse-content\"&gt;&lt;div class=\"aplus-module-wrapper apm-spacing apm-floatnone\"&gt;&lt;div class=\"apm-sidemodule aplus-module-content\"&gt;&lt;div class=\"apm-sidemodule-imageleft apm-hero-image\"&gt;&lt;img alt=\"\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e305bd70-5ed0-4d85-ae7e-0053ff022291._SR970,300_.png\" data-mce-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/e305bd70-5ed0-4d85-ae7e-0053ff022291._SR970,300_.png\"&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=\"celwidget aplus-module module-6\" cel_widget_id=\"aplus-module-6\"&gt;&lt;div class=\"aplus-module-wrapper\"&gt;&lt;div class=\"apm-spacing aplus-module-content\" id=\"aplus-module-6-4\"&gt;&lt;div class=\"apm-hovermodule\"&gt;&lt;div&gt;&lt;div class=\"apm-hovermodule-slides\"&gt;&lt;br data-mce-bogus=\"1\"&gt;&lt;/div