ium giúp tăng cường hệ thống miễn dịch.&lt;br&gt;\r\nAxit béo Omega 3 và 6 giúp da khỏe mạnh, lông óng mượt.&lt;br&gt;\r\nCanxi, Photpho tốt cho hệ xương và răng.&lt;br&gt;\r\nLà thức ăn cho chó chứa thành phần dễ tiêu hóa và hấp thu.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;THÀNH PHẦN&amp;nbsp;&lt;/strong&gt;&lt;br&gt;\r\nĐộ đạm (tối thiểu) ..................................... 9%&lt;br&gt;\r\nĐộ béo (tối thiểu) ...................................... 8%&lt;br&gt;\r\nChất xơ (tối đa) ......................................... 1.5%&lt;br&gt;\r\nĐộ ẩm (tối đa) ........................................... 78%&lt;br&gt;\r\nLinoleic Acid (tối thiểu) .............................. 1%&lt;br&gt;\r\nCanxi (tối thiểu) ........................................ 0.28%&lt;br&gt;\r\nPhotpho (tối thiểu) ................................... 0.17%&lt;br&gt;\r\nVitamin E (tối thiểu) .................................. 150 IU/KG&lt;br&gt;\r\nDHA (tối thiểu) .......................................... 0.02%&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;HƯỚNG DẪN SỬ DỤNG&lt;/strong&gt;&lt;br&gt;\r\n- Đậy kín sau khi không sử dụng, tránh sự xâm nhập của chuột bọ.&lt;br&gt;\r\n- Để xa tầm tay của trẻ em.&lt;br&gt;\r\n- Sản phẩm phù hợp cho trưởng thành.&lt;br&gt;\r\n- Bạn cũng có thể dùng sản phẩm ăn kèm với cơm, bánh mì... Ngoài ra bạn cũng có thể tham khảo thêm smartheart lon cho chó trưởng thành vị thịt bò và thịt cừu 400g.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br&gt;\r\n………………Petizen………………&lt;br&gt;\r\n\r\n#CutePets #HàNội #CầuGiấy #ThúCưng #Chó #Mèo&lt;/p&gt;\r\n																			\r\n										&lt;/div&gt;</div>'),(63,85,0,32,'Pate Lon Smart Heart 400g Dành cho chó lớn'),(64,75,0,33,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											\r\n								\r\n											&lt;p&gt;Thức ăn cho chó FIBs 1.5kg Dành cho chó lớn tất cả các dòng &lt;br&gt;\r\nFib là một loại thức ăn cung cấp đầy đủ và cân bằng các nhu cầu dinh dưỡng cho chó trưởng thành và cho tất cả các giống, kích cỡ. Fib chứa một công thức độc quyền xây dựng với một sự kết hợp của các loại thịt không thể cưỡng lại cho chó.&lt;/p&gt;\r\n&lt;p&gt;Mô tả sản phẩm&lt;br&gt;\r\n– Fib’s là một sản phẩm thức ăn đầy đủ và cân đối ,được phát triển để đáp ứng toàn bộ nhu cầu dinh dưỡng của Chó trưởng thành,mọi giống và mọi kích cỡ.&lt;br&gt;\r\n– Fis’s có công thức độc quyền gồm hỗn hợp các loại thịt khoái khẩu của Chó.&lt;br&gt;\r\nFib của có hai hình dạng của xương &amp;amp; tròn cũng được thiết kế cho chó trưởng thành mà không có chất tạo màu nhân tạo.lợi ích chính Fib cho chó trưởng thành là:&lt;br&gt;\r\nCân bằng dinh dưỡng&lt;br&gt;\r\nCho da khỏe mạnh&lt;br&gt;\r\nXương khỏe mạnh&lt;/p&gt;\r\n&lt;p&gt;Thành phần hàm lượng dinh dưỡng&lt;br&gt;\r\nĐạm (min) 26%&lt;br&gt;\r\nCanxi (min – max) 1,0 – 1,7%&lt;br&gt;\r\nBéo thô (min) 12%&lt;br&gt;\r\nPhốt pho tổng số (min – max) 0,8% – 1,5%&lt;br&gt;\r\nXơ thô (max) 6%&lt;br&gt;\r\nLysin tổng số (min) 1,2%&lt;br&gt;\r\nĐộ ẩm (max) 12%&lt;br&gt;\r\nMethionine và cystine tổng số (min) 0,8%&lt;br&gt;\r\nNăng lượng trao đổi (min) 3.500 Kcal/kg&lt;br&gt;\r\nHóa chất và kháng sinh (max) None&lt;br&gt;\r\nNhững lợi ích chính: Calcium, DHA, Tăng trưởng Cân đối, Omega 3 &amp;amp; 6&lt;br&gt;\r\nThành phần&lt;br&gt;\r\nNgô, cám lúa mì, , Sản phẩm mì, gia cầm Bột Cám gạo, đậu nành đậu nành, gia cầm Fat, Wheat Gluten, thịt và xương Bột Khoáng sản (sắt, đồng, mangan, kẽm, iốt, Selen), vitamin (A , D3, E, K3, B1, B2, B6, B12, PP, D Calcium pantothenate, Biotin, folic Acid, Choline), Dicalcium Phosphate, Calcium Carbonate, muối, axit amin, Antimold, chống oxy hóa, màu.&lt;br&gt;\r\n………………Petizen………………&lt;br&gt;\r\n\r\n#CutePets #HàNội #HàĐông #ThúCưng #DànhChoThúCưng #Chó #Mèo&lt;/p&gt;\r\n																			\r\n										&lt;/div&gt;</div>'),(65,85,0,33,'Thức ăn cho chó FIBs Adult 1.5kg Dành cho chó lớn tất cả các dòng'),(66,75,0,34,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											\r\n								\r\n											&lt;p&gt;Ganador Adult 1.5kg Thức ăn cho chó Vị Thịt gà và cừu non &lt;br&gt;\r\n- Trọng Lượng: 1.5kg&amp;nbsp;&lt;br&gt;\r\n- Được lập công thức và thiết kế tại Pháp đảm bảo mức độ dinh dưỡng cao để duy trì giai đoạn sống lâu dài nhất của chó lớn, cho tất cả các giống và kích cỡ.&lt;br&gt;\r\n- Hoàn thiện với công nghệ tiến tiến trình bày cao cấp, thơm ngon và đúng cỡ hạt cho chó lớn.&lt;br&gt;\r\n- Đặc biệt thiết kế cho chế độ dinh dưỡng đầy đủ và cân đối&lt;br&gt;\r\n- Là sản phẩm duy nhất trên thị trường hợp hai nguồn protein tuyệt hảo cho mức dinh dưỡng tốt nhất.&lt;br&gt;\r\nNHỮNG LỢI ÍCH CHÍNH&lt;br&gt;\r\n- Vitamin &amp;amp; Khoáng chất&lt;br&gt;\r\n- Các Thành tố Chất lượng Cân đối&lt;br&gt;\r\n- Phân chặt &amp;amp; Ít mùi hôi&lt;br&gt;\r\n- Omega 3 &amp;amp; 6&lt;br&gt;\r\nTHÀNH TỐ&lt;br&gt;\r\n- Ngô, các Sản phẩm Lúa mì, Bột Đậu nành, Bột Gia cầm, Gạo tấm, Cám gạo, Mỡ Gia cầm, Bột Thịt cừu non, Gluten Lúa mì, Bột Thịt và Xương, Cám Lúa mì, Chất khoáng (Sắt, Đồng, Mangan, Kẽm, Iot, Selenium), các Vitamin (A,D3, E, K3, B1, B2, B6, B12, PP, D Calcium Pantothenate, Biotin, Axit Folic, Choline), Dicalcium Phosphate, Calcium Carbonate, Muối, các Axit Amin, Chất chống mốc, Chất Chống oxy hóa, Chất tạo màu, Chất hấp dẫn, trích tinh Yuccah.&lt;br&gt;\r\nPHÂN TÍCH DINH DƯỠNG&lt;br&gt;\r\n- Protein thô (tối thiểu) 21%&lt;br&gt;\r\n- Chất béo thô (tối thiểu) 10%&lt;br&gt;\r\n- Chất xơ thô (tối đa) 6%&lt;br&gt;\r\n- Độ ẩm (tối đa) 12%&lt;br&gt;\r\nKHẨU PHẦN ĂN ĐỀ NGHỊ TRONG 1 NGÀY:&lt;br&gt;\r\n- Rất nhỏ 1 – 5 kg: 33 – 112 gr&lt;br&gt;\r\n- Nhỏ 5 – 10 kg: 112 – 188 gr&lt;br&gt;\r\n- Trung bình 10 – 20 kg: 188 – 316 gr&lt;br&gt;\r\n- Lớn 20 – 40 kg: 316 – 531 gr&lt;br&gt;\r\n- Rất lớn 40 – 70 kg: 531 – 808 gr&lt;br&gt;\r\n………………Petizen………………&lt;br&gt;\r\n\r\n#ThứcĂnChoChó #Ganador #Adult #CutePets #HàNội #CầuGiấy #ThúCưng #DànhChoThúCưng#Chó #Mèo&lt;/p&gt;\r\n																			\r\n										&lt;/div&gt;</div>'),(67,85,0,34,'Ganador Adult 1.5kg Thức ăn cho chó lớn Vị Thịt gà và cừu non'),(68,75,0,35,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;p&gt;Pate cho chó Pedigree &amp;nbsp;130g - Pate cho chó - &amp;nbsp; - Thức Ăn Cho Chó Pedigree Vị Gà Nấu Sốt 130g có công thức với từng miếng thịt mềm trong nước sốt cho hương vị thơm ngon mà những chú chó cực kì yêu thích. Một chế độ dinh dưỡng đầy đủ và cân bằng bao gồm các vitamin, khoáng chất, canxi, protein, chất xơ và omega cho cơ thể các chú cún có một sức khỏe toàn diện, bảo đảm sự phát triển cả về thể chất lẫn ngoại hình. - Thông tin sản phẩm: 130g x 1 gói - Thành phần: Thịt gà, nước thịt, vitamin C, A, D, D3, B2, B12, B6, E và vitamin B1, khoáng chất như canxi, đồng sulfat, kẽm, kali clorua, sắt, nghệ, chiết xuất trà xanh và muối i-ốt. - Công dụng: Sốt vị gà Pedigree Chicken 130g tích hợp nhiều chất dinh dưỡng, bảo đảm những chú cún của bạn sẽ xin xắn, khỏe mạnh với Omega &amp;amp; Zinc cho da và lông mượt mà, ít rụng, Protein cho cơ bắp chắc khỏe, dẻo dai. - Ngoài ra, Vitamin &amp;amp; khoáng chất cho cơ thể những chú cún luôn khỏe mạnh, linh hoạt. Chất xơ cho hệ thống tiêu hóa tốt, tăng cường khả năng hấp thu chất dinh dưỡng, góp phần vào sự phát triển đồng đều cho các chú cún. Chất Calsium &amp;amp; phospho cho xương và răng chắc khoẻ. - Hướng dẫn sử dụng: + Bạn có thể cho cún ăn bằng cách dùng ăn kèm với cơm hay bánh mì - Sản phẩm phù hợp với nhiều loại cún có độ tuổi khác nhau - Hạn sử dụng in trên bao bì ………………Petizen……………… #PateChoChó #ThứcĂnChoChó #Pedigree #VịGàNấuSốt #ChickenChunksFlavorinGravy #pate #CutePets #HàNội #CầuGiấy&lt;/p&gt;</div>'),(69,85,0,35,'Pate cho chó Pedigree  130g'),(70,75,0,36,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;p&gt;Pate cho chó Pedigree &amp;nbsp;130g - Pate cho chó - &amp;nbsp; - Thức Ăn Cho Chó Pedigree Vị Gà Nấu Sốt 130g có công thức với từng miếng thịt mềm trong nước sốt cho hương vị thơm