bồn cầu CitiKitty Bộ sản phẩm gồm + 1 Khay to: dùng để hướng dẫn mèo + 1 Khay nhỏ: dùng để dự phòng + Tặng kèm 1 gói cỏ catnip HƯỚNG DẪN SỬ DỤNG: - Bước 1: Mở hộp sản phẩm, đổ cát dùng cho mèo (nên sử dụng loại có thể xả được vào toilet ) sau đó thay vào chỗ khay cát cũ. kéo dần khay cát vào phòng vệ sinh giúp mèo quen với sự thay đổi vị trí để khay cát. Nâng dần lên bệ, mỗi lần nâng lên khoảng 5cm, cuối cùng là để lên bệ toilet. * Lưu ý: Luôn để nhà vệ sinh khô ráo, mở cửa, để khay sẵn lên bệ. (nên sử dụng phòng vệ sinh tầng 1 ít người sử dụng, khi người sử dụng xong lại đặt khay như cũ). - Bước 2: Khoét 1 lỗ nhỏ ở giữa khay, mỗi lần khoét nên để cho mèo thích nghi trong vòng 1 tuần (có thể lâu hơn tuỳ theo từng bé). Mỗi lần khoét to hơn thì nên đổ cát vào khay ít hơn lần trước. Khi lỡ khoét lỗ quá to mà bé chưa quen, có thể nhảy khỏi khay, sử dụng khay nhỏ (back up) khoét lỗ nhỏ hơn, khi nào bé quen thì lại bỏ ra. Trong trường hợp không cần dùng đến thì có thể dùng cho mèo con, mèo mới về - Bước 3: Sau khi mèo đã quen với mức to nhất và ít cát nhất, có thể bỏ khay ra và mèo tự đi vệ sinh mà không cần cát, khay. ………………Petizen………………  #CutePets #HàNội #CầuGiấy #ThúCưng #DànhChoThúCưng #Chó #Mèo&lt;/p&gt;\r\n																			\r\n										&lt;/div&gt;</div>'),(107,85,0,54,'Bộ huấn luyện mèo đi vệ sinh vào bồn cầu CitiKitty'),(108,75,0,55,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											\r\n								\r\n											&lt;p&gt;&lt;strong&gt;Clicker huấn luyện chó&lt;/strong&gt;&lt;br&gt;\r\n?? Clicker như 1 cái công tắc điện, mỗi lần bấm sẽ có 1 tiếng kêu Click phát ra.&lt;br&gt;\r\n?? Cách hoạt động của clicker rất đơn giản. Người ta tạo sự liên kết giữa mỗi lần bấm Clicker và 1 lần thưởng đồ ăn cho cún. Mỗi lần bấm clicker thì thưởng đồ ăn cho cún ngay lập tức. Bằng cách này, lặp lại nhiều lần, con chó sẽ hiểu là mỗi lần nghe tiếng clicker là nó sẽ được thưởng. Từ đí con chó sẽ có thói quen làm mọi việc theo ý người huấn luyện.&amp;nbsp;&lt;br&gt;\r\n✔ Người huấn luyện sẽ bấm clicker ngay khi con chó làm việc gì đó đúng ý.&lt;br&gt;\r\n?? Hướng dẫn sử dụng:&lt;br&gt;\r\n+ Ban đầu bạn hãy mua loại thức ăn mà chú chó của bạn yêu thích. Gọi chú cún đến gần mình.&lt;br&gt;\r\n+ Sau đó bạn hãy lấy Clicker ra, bỏ thức ăn và clicker trên tay. Ngay sau khi bạn bấm Clicker thì đồng thời cho chú cún của bạn ăn. Mỗi lần chỉ nên cho ăn ít một, không nên cho ăn nhiều để tránh tình trạng no trước khi buổi tập kết thúc khiến cho chú chó nhanh no!&lt;br&gt;\r\n+ Trung bình thì bạn nên thực hiện bước này từ 5 đến 10 lần, nếu chú cún có khả năng nhận thức tốt thì tập luyện ít. Còn nhận thức kém thì cần phải tập luyện nhiều hơn.&lt;br&gt;\r\n+ Sau đó bạn thực hiện ném đồ ăn ra xa, nhưng không cho cún ăn. Chỉ khi nào bấm clicker thì mới cho cún ăn. Như vậy cũng hình thành cho chú cún nhà bạn không ăn linh tinh. Bước này cần luyện tập khoảng 10 lần.&lt;br&gt;\r\n+ Mỗi lần tập luyện thời gian sẽ kéo dài vào khoảng 15 phút. Bạn cũng không nên tập nhiều hơn, để tránh chú cún của bạn rơi vào tình trạng bị chán nản.&lt;br&gt;\r\n………………Petizen………………&lt;br&gt;\r\n\r\n#CutePets #HàNội #HàĐông #ThúCưng #DànhChoThúCưng #Chó #Mèo&lt;/p&gt;\r\n																			\r\n										&lt;/div&gt;</div>'),(109,85,0,55,'Clicker huấn luyện chó'),(110,75,0,56,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											\r\n								\r\n											&lt;p&gt;&lt;strong&gt;Chuông huấn luyện cho thú cưng - Rung chuông xin ăn, xin phép ra ngoài&lt;/strong&gt;&lt;br&gt;\r\nHỌC RUNG CHUÔNG:chu&lt;br&gt;\r\n- Bước 1: Thiết kế một chiếc chuông ở cửa, hoặc chỗ cho ăn vừa tầm với chân với của thú cưng để chúng dễ dàng lắc chuông.&lt;br&gt;\r\n- Bước 2: Chuẩn bị đồ ăn vặt mà thú cưng thích để thưởng mỗi khi thú cưng làm đúng.&lt;br&gt;\r\nBước 3: Gọi thú cưng ra gần chỗ chuông, hô khẩu lệnh “Chạm” rồi cầm chân thú cưng chạm vào chuông cho chuông kêu, sau đó mở cửa. Hoặc bạn cũng có thể dùng đồ ăn đặt gần chuông sao cho cún muốn ăn phải chạm vào chuông. Khi chuông kêu thì thưởng đồ ăn cho cún.&lt;br&gt;\r\nBước 4: Bạn nhớ khen và vuốt đầu nó mỗi khi nó rung được chuông. Lặp lại các bước 3 từ 10 -15 lần cho đến khi bạn hô khẩu lệnh và thú cưng tự chạm được.&lt;br&gt;\r\nDẠY CHÓ MÈO RUNG CHUÔNG MỖI LẦN ĐI VỆ SINH:&lt;br&gt;\r\n- Trước khi bạn dắt cún đi vệ sinh, hô khẩu lệnh rung chuông cho cún trước rồi mới mở cửa. Nếu cún rung chuông bạn lập tức khen và thưởng ngay, sau đó mở cửa dắt cún ra ngoài.&lt;br&gt;\r\n- Bước này rất quan trọng sẽ hình thành nên thói quen trước khi ra khỏi nhà phải rung chuông ở chó.&lt;br&gt;\r\nLUYỆN CHO THÀNH THẠO:&lt;br&gt;\r\nTrước khi dắt cho đi dạo, gọi chó ra cửa, chỉ vào chuông nếu cho rung chuông thì mới dắt ra ngoài.&lt;br&gt;\r\nChúc bạn và cún thực hiện thành công bài huấn luyện này nhé!&lt;br&gt;\r\n………………Petizen………………&lt;br&gt;\r\n\r\n#Chuônghuấnluyện #CutePets #HàNội #CầuGiấy #ThúCưng #DànhChoThúCưng #Chó #Mèo&lt;/p&gt;\r\n																			\r\n										&lt;/div&gt;</div>'),(111,85,0,56,'Chuông huấn luyện cho thú cưng - Rung chuông xin ăn, xin phép ra ngoài'),(112,75,0,57,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											\r\n								\r\n											&lt;h2&gt;&lt;strong&gt;Gậy tét đít - Huấn luyện chó mèo&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;- Phục vụ nhu cầu huấn luyện chó mèo nên CutePets Nhập hàng mới que tét đít cho chó mèo&lt;br&gt;\r\n- Được làm bằng chất liệu cao su mềm, thân que được bện từ dây dù bên trong là lỗi kim loại có tính đàn hồi cao nên khi sử dụng rất hiệu quả với những chú chó mèo bướng bỉnh nghịch ngợm không nghe theo lệnh chủ.&lt;br&gt;\r\n- Chỉ cần vung nhẹ que tét đít sẽ tạo lực mạnh khiến cho những chú chó, mèo bất trị nằm im&amp;nbsp;&lt;br&gt;\r\n- Vì được làm từ cao su nên gậy huấn luyện sẽ chỉ gây đau phần mềm và gây sợ cho các bé mà không làm tổn thương nhiều.&lt;br&gt;\