n																			\r\n										&lt;/div&gt;</div>'),(135,85,0,68,'Vòng cổ Panda In hình dạ quang'),(136,75,0,69,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											\r\n								\r\n											Rọ mõm vải da mềm dành cho chó \r\nKích thước:\r\n+ Size XS: chu vi mõ 13-17cm, chu vi đầu 17-28cm, khoảng cân nặng ~0.5 - 6kg\r\n+ Size S: chu vi mõ 18-22cm, chu vi đầu 21-33cm, khoảng cân nặng ~4&amp;nbsp;- 14kg\r\n+ Size M: chu vi mõ 23-27cm, chu vi đầu 24-36cm, khoảng cân nặng ~10&amp;nbsp;- 27kg\r\n+ Size L: chu vi mõ 29-33cm, chu vi đầu 31-40cm, khoảng cân nặng ~24&amp;nbsp;- 45kg\r\n+ Size XL: chu vi mõ 30-35cm, chu vi đầu 38-49cm, khoảng cân nặng dưới 60kg\r\n\r\n&amp;gt;&amp;gt; Chú ý: tùy giống chó mà sẽ có tỉ lệ mõm và cân nặng khác nhau. nên cân nặng chỉ mang tính chất tham khảo. các bạn nên đo kích thước để đảm bảo tính chính xác.\r\n\r\n- Chiếc rọ mõm &amp;nbsp;sẽ là một phụ kiện không thể thiếu giúp đảm bảo an toàn cho những người xung quanh khi bạn đưa cún yêu đến những nơi công cộng.\r\n+ Với thiết kế chắc chắn nhưng mềm mại, đồng thời đầu rọ được thiết kế thoáng, rọ mõm vải da sẽ mang đến cho chú cún cưng của bạn cảm giác thật thoải mái khi đeo.\r\n\r\n+ Có thể dùng kết hợp với vòng cổ để tăng sự chắc chắn cho sản phẩm\r\nĐẶC ĐIỂM NỔI BẬT\r\n- Thiết kế mềm mại và đầu rọ được thiết kế thoáng giúp mang đến cho chú cún cưng cảm giác thoải mái và êm ái khi đeo.\r\n- Thiết kế khóa nới linh động giúp bạn dễ dàng canh chỉnh sao cho chú cún cưng cảm thấy thoải mái nhất\r\n- Có nhiều kích thước khác nhau phù hợp cho thú cưng nhà bạn\r\n\r\n………………Petizen………………#CutePets&amp;nbsp;#HàNội&amp;nbsp;#CầuGiấy&amp;nbsp;#ThúCưng&amp;nbsp;#DànhChoThúCưng#Chó&amp;nbsp;#Mèo\r\n																			\r\n										&lt;/div&gt;</div>'),(137,85,0,69,'Rọ mõm vải da mềm dành cho chó'),(138,75,0,70,'<div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;div class=\"rte\"&gt;\r\n											