script&gt;\r\n        //set default selected value\r\n        document.getElementsByName(\"from\")[0].options[154].selected = \'selected\';\r\n        document.getElementsByName(\"to\")[0].options[150].selected = \'selected\';\r\n        //get from - to currency\r\n        document.getElementsByName(\"from\")[0].addEventListener(\"change\", resetData);\r\n        document.getElementsByName(\"to\")[0].addEventListener(\"change\", resetData);\r\n\r\n        function resetData() {\r\n            document.getElementById(\"from-amount\").value = \"\";\r\n            document.getElementById(\"to-amount\").innerHTML = \"...\";\r\n        }\r\n\r\n        //get rate\r\n        var xhttp = new XMLHttpRequest();\r\n        var json = {};\r\n        var rates = [];\r\n        xhttp.onreadystatechange = function () {\r\n            if (this.readyState == 4 &amp;&amp; this.status == 200) {\r\n                json = JSON.parse(xhttp.responseText);\r\n                for (let i in json.rates) {\r\n                    rates.push([i, json.rates[i]]);\r\n                }\r\n\r\n            }\r\n        };\r\n        xhttp.open(\"GET\", \"exchangerates.txt\", true);\r\n        xhttp.send();\r\n        //convert\r\n        document.getElementById(\"convert\").addEventListener(\"click\", convert);\r\n        function convert() {\r\n            var fromIndex = document.getElementsByName(\"from\")[0].selectedIndex;\r\n            var toIndex = document.getElementsByName(\"to\")[0].selectedIndex;\r\n            var amount = document.getElementById(\"from-amount\").value;\r\n\r\n            var fromCurrency = document.getElementsByName(\"from\")[0][fromIndex].value;\r\n            var toCurrency = document.getElementsByName(\"to\")[0][toIndex].value;\r\n            var myHeaders = new Headers();\r\n            myHeaders.append(\"apikey\", \"58oP7cl1S1dq6953z7kamtfFnX57Im5Y\");\r\n\r\n            var requestOptions = {\r\n                method: \'GET\',\r\n                redirect: \'follow\',\r\n                headers: myHeaders\r\n            };\r\n            if (amount &gt; 0) {\r\n                fetch(\"https://api.apilayer.com/exchangerates_data/convert?to=\" + toCurrency + \"&amp;from=\" + fromCurrency + \"&amp;amount=\" + amount, requestOptions)\r\n                    .then(response =&gt; response.json())\r\n                    .then((result) =&gt; {\r\n                        document.getElementById(\"to-amount\").value = result.result;\r\n                    })\r\n                    .catch(error =&gt; console.log(\'error\', error));\r\n            }\r\n        }\r\n\r\n\r\n\r\n\r\n    &lt;/script&gt;\r\n&lt;!-- \r\n    &lt;script&gt;\r\n        var xhttpExrate = new XMLHttpRequest();\r\n        var jsonExrate = {};\r\n        var symbols = [];\r\n        var myHeaders = new Headers();\r\n        \r\n\r\n        document.getElementById(\"exrate\").addEventListener(\'click\', getRate);\r\n\r\n\r\n        function getRate() {\r\n\r\n            var symbols1 = [];\r\n            var options = document.getElementsByName(\"exchange-result\");\r\n            // console.log(options[0][options[0].selectedIndex].value);\r\n            //myHeaders.set(\"apikey\", \"58oP7cl1S1dq6953z7kamtfFnX57Im5Y\");\r\n\r\n        var requestOptions = {\r\n            method: \'GET\',\r\n            redirect: \'follow\',\r\n            headers: myHeaders\r\n        };\r\n        fetch(\"https://api.apilayer.com/exchangerates_data/symbols\")\r\n            .then(response =&gt; response.json())\r\n            .then((result) =&gt; {\r\n                for (let i in result.symbols) {\r\n                    symbols.push([i, result.symbols[i]]);\r\n                }\r\n                symbols.forEach(symbol =&gt; {\r\n                    document.getElementsByName(\"exchange-result\")[0].innerHTML += \'&lt;option value=\' + symbol[0] + \'&gt;\' + symbol[1] + \'(\' + symbol[0] + \')&lt;/option&gt;&lt;br&gt;\';\r\n                    document.getElementsByName(\"exchange-result\")[1].innerHTML += \'&lt;option value=\' + symbol[0] + \'&gt;\' + symbol[1] + \'(\' + symbol[0] + \')&lt;/option&gt;&lt;br&gt;\';\r\n                    document.getElementsByName(\"exchange-result\")[2].innerHTML += \'&lt;option value=\' + symbol[0] + \'&gt;\' + symbol[1] + \'(\' + symbol[0] + \')&lt;/option&gt;&lt;br&gt;\';\r\n                    document.getElementsByName(\"exchange-result\")[3].innerHTML += \'&lt;option value=\' + symbol[0] + \'&gt;\' + symbol[1] + \'(\' + symbol[0] + \')&lt;/option&gt;&lt;br&gt;\';\r\n                });\r\n                document.getElementsByName(\"exchange-result\")[0].options[150].selected = \'selected\';\r\n                document.getElementsByName(\"exchange-result\")[1].options[139].selected = \'selected\';\r\n                document.getElementsByName(\"exchange-result\")[2].options[7].selected = \'selected\';\r\n                document.getElementsByName(\"exchange-result\")[3].options[46].selected = \'selected\';\r\n            })\r\n            .catch(error =&gt; console.log(\'error\', error));\r\n            var myHeaders = new Headers();\r\n            myHeaders.append(\"apikey\", \"58oP7cl1S1dq6953z7kamtfFnX57Im5Y\");\r\n\r\n            var requestOptions = {\r\n                method: \'GET\',\r\n                redirect: \'follow\',\r\n                headers: myHeaders\r\n            };\r\n            for (let i = 0; i &lt; 4; i++) {\r\n                symbols1[i] = options[i][options[i].selectedIndex].value;\r\n            }\r\n            fetch(\"https://api.apilayer.com/exchangerates_data/latest?base=VND\", requestOptions)\r\n                .then(response =&gt; response.json())\r\n                .then((result) =&gt; {\r\n                    document.getElementsByClassName(\"rate\")[0].innerHTML = result.rates[symbols1[0]] * 1000;\r\n                    document.getElementsByClassName(\"rate\")[1].innerHTML = result.rates[symbols1[1]] * 1000;\r\n                    document.getElementsByClassName(\"rate\")[2].innerHTML = result.rates[symbols1[2]] * 1000;\r\n                    document.getElementsByClassName(\"rate\")[3].innerHTML = result.rates[symbols1[3]] * 1000;\r\n                })\r\n                .catch(error =&gt; console.log(\'error\', error));\r\n\r\n        }\r\n        function resetExratesData() {\r\n            document.getElementsByClassName(\"rate\")[0].innerHTML = \"...\";\r\n            document.getElementsByClassName(\"rate\")[1].innerHTML = \"...\";\r\n            document.getElementsByClassName(\"rate\")[2].innerHTML = \"...\";\r\n            document.getElementsByClassName(\"rate\")[3].innerHTML = \"...\";\r\n\r\n        }\r\n    &lt;/script&gt; --&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</div>','2022-12-08 19:49:23','2022-12-08 20:37:24',1);
